import './App.css';
import React from "react";
import Darkmode_Wrapper from './Wrapper-Elements/Darkmode-Wrapper';
import Header from './Content-Elements/Header'
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";

// A function that wraps the Application (alternate name: AppWrapper)
class App extends React.Component {
  darkMode = false;
  render () {
    return (
      <div id="AppWrapper">
        <Darkmode_Wrapper isDarkMode={this.darkMode}>
          <div id="test">
            <Header title="Varunan Varathan" readMore="To My Journey" tabs = {[
              {name: "My Journey"},
              {name : "Projects"}, 
              {name: "About Me"}, 
              {name: "GitHub"}
            ]}/>
          </div>
        </Darkmode_Wrapper>
      </div>
    );
  }
}

export default App;
